import React from "react";
import styled from "styled-components";

const Container = styled.div`
  background-color: red;
  width: 100vw;
  height: 100%;
  padding: 0px 100px;
`;

const HeaderBlock = styled.div`
  background-color: blue;
  width: 100%;
  height: 200px;
`;

const HeaderBlockTitle = styled.span`
  color: black;
  font-size: 20px;
  font-weight: 600;
  background-color: white;
  display: flex;
  justify-content: center;
`;

const HeaderBlockDescription = styled.span`
  color: black;
  font-size: 20px;
  font-weight: 600;
  background-color: white;
  display: flex;
  justify-content: center;
`;

const BodyBlock = styled.div`
  background-color: green;
  width: 100%;
  height: 500px;
`;

const IntroductionBlocks = styled.div`
  background-color: white;
  width: 100%;
  height: 500px;
`;

const CurriculumBlock = styled.div`
  background-color: yellow;
  width: 100%;
  height: 500px;
`;

const HomePresenter = () => (
  <Container>
    <HeaderBlock>
      <HeaderBlockTitle>앱의 구동방식을 설계하는 단계.</HeaderBlockTitle>
    </HeaderBlock>
    <HeaderBlock>
      <HeaderBlockTitle>앱의 구동방식을 설계하는 단계.</HeaderBlockTitle>
    </HeaderBlock>
    <IntroductionBlocks></IntroductionBlocks>
    <BodyBlock></BodyBlock>
    <CurriculumBlock></CurriculumBlock>
  </Container>
);

export default HomePresenter;
